import './Con'
const Container2 = ({background,text}) => {
    return (
         <div className="Container2" style={
            {backgroundImage:`url(${background})`}}>
         <div className="textContainer2">
            <p>{text}</p>
         </div>
         </div>
      );
}
 
export default Container2;
